style.css:
@-moz-document domain("roblox.com") {
/* Select the play button by its class or ID */
  .play-button, .btn-primary-play, .game-card-button, .btn-play-game { 
    background-color: cyan !important; /* Cyan background */
    color: white !important; /* White text */
    border: 2px solid white !important; /* White border */
    border-radius: 5px; /* Rounded corners */
  }
  
  /* Add hover effect */
  .play-button:hover, .btn-primary-play:hover, .game-card-button:hover, .btn-play-game:hover {
    background-color: white !important; /* White background on hover */
    color: cyan !important; /* Cyan text on hover */
    border-color: cyan !important; /* Cyan border on hover */
  }
  
  /* Additional style for text inside the button */
  .play-button span, .btn-primary-play span, .game-card-button span, .btn-play-game span {
    color: white !important; /* Ensure the text color inside the button is white */
  }
}
